import React from "react";
import "./Navbar.css";
import { Link } from "react-router-dom";
import SearchIcon from "@mui/icons-material/Search";
function Navbar() {
  return (
    <nav className="navBar">
      <Link to="/">
        <img
          src="https://toppng.com/uploads/preview/logo-designing-for-house-of-tshirts-online-shopping-logo-desi-11563314444xvpv60fw8y.png"
          alt="error"
          className="navBar__logo"
        />
      </Link>
      <div className="navBar__search">
        <input type="text" className="navBar__search_type" />
        <SearchIcon className="navBar__search_icon" />
      </div>
      <Link>
      <span>Hello</span>
      <span>Sign</span>
      
      
      </Link>
    </nav>
  );
}

export default Navbar;
